*
 * 向客户端传评论是否是置顶
 *
 * @param {number} params.status - 是否置顶 0/1
 * @returns {Promise<*>}
 *
 * @example
 *   lib.exec('notify-refresh-top-status-result', {
    params: {
      status: 1
    },
  }).catch((err) => {
    alert(`[refresh][notify-refresh-top-status-result][error] ${JSON.stringify(err, null, 2)}`);
  });

